import Person from './Person/Person';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">

          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <Person></Person>

        </header>
      </div>
    );
  }
}

export default App;
